import React from "react";
import { ListGroup } from "react-bootstrap";
import "./EnemyList.css";

const EnemyList = ({ enemyTracker }) => {
  return (
    <ListGroup>
      {enemyTracker &&
        enemyTracker.map((enemy) => <ListGroup.Item>{enemy}</ListGroup.Item>)}
    </ListGroup>
  );
};

export default EnemyList;
